window.bookSummaryJSON = "<p>A world divided.<br> A queendom without an heir. <br> An ancient enemy awakens. </p> <p>The House of Berethnet has ruled Inys for a thousand years. Still unwed, Queen Sabran the Ninth must conceive a daughter to protect her realm from destruction - but assassins are getting closer to her door. </p> <p>Ead Duryan is an outsider at court. Though she has risen to the position of lady-in-waiting, she is loyal to a hidden society of mages. Ead keeps a watchful eye on Sabran, secretly protecting her with forbidden magic. </p> <p>Across the dark sea, Tan√© has trained to be a dragonrider since she was a child but is forced to make a choice that could see her life unravel. Meanwhile, the divided East and West refuse to parley, and forces of chaos are rising from their sleep.</p>"; 
